import React from "react";

function Skills() {
  return (
    <div>
      <h1 id="skills">Tech Chops</h1>
      <div className="row">
        <div className="column">
          <h4>Front End</h4>
          <p>HTML5 - CSS3 - React.js - Anime.js</p>
        </div>
        <div className="column">
          <h4>Back End</h4>
          <p>Express - Knex - SQL - PostgreSQL</p>
        </div>
        <div className="column">
          <h4>Other Stuff</h4>
          <p>Mocha - Chai - Cors - Git - GitHub - Node Package Manager</p>
        </div>
      </div>
    </div>
  );
}

export default Skills;
